CREATE DATABASE IF NOT EXISTS `benchmark` DEFAULT CHARACTER SET utf8;

USE `benchmark`;

DROP TABLE IF EXISTS `offer`;
CREATE TABLE `offer` (
  `nr` int(11) primary key,
  `product` int (11),
