  `publisher` int(11),
  `publishDate` date,
  INDEX USING BTREE (product),
  INDEX USING BTREE (vendor)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES `offer` WRITE;
ALTER TABLE `offer` DISABLE KEYS;

